import React from 'react';
import Toolbar from './componentes/Toolbar/Toolbar'
import './App.css';
import Topbuttons from './componentes/Topbuttons/Topbuttons';
import SetencaBox from './componentes/SetencaBox/SetencaBox';

class PageSelect extends React.Component{
  constructor(props){
    super();
    this.state = {
        inNew : true,
        setenceBox : true,
    }
  }

  render(){
    let setence = this.props.setenceBox;
    return(
      <div>
         <Topbuttons inNew = {this.state.inNew} setenceBox = {this.state.setenceBox}/>
          <div className = "space_setence">
            {setence}
          </div>
          <div className = "space_setence">
            {this.props.setenceBox}
          </div>
          <div className = "space_setence">
            {this.props.setenceBox}
          </div>
      </div>
    )
  }
}

function App() {
  return (
     <div className="home">
      <header className="navbar_toolbar">
        <Toolbar /> 
      </header>
        <div className= "topbuttonDiv">
          <PageSelect/>
        </div>
    </div>
  );
}

export default App;
